import './App.css';
import {Container} from 'react-bootstrap'
import Header from './Components/Header';
import Footer from './Components/Footer';
import Home from './Components/Body/Home';
import { Router } from 'react-router-dom';


function App() {
  return (
    <Router>
    <div>
      <Header />
      <main>
        <Container>
          <Home />                  
        </Container>    
      </main>
      <Footer />
    </div>
    </Router>
  );
}

export default App;
